import styled from "styled-components";

export const Div = styled.div`
  text-align: center;
  margin-top: 40px;

  @media screen and (max-width: 810px) {
    margin-top: 250px;
  }
`;

export const ConstCostEstimator = () => {
  return (
    <div
      className="border"
      style={{
        marginTop: 50,
        backgroundColor: "#F8F8F6",
        width: 450,
        borderRadius: 5,
      }}
    >
      <h4 style={{ marginTop: 15 }}>Construction Cost Estimator</h4>
      <div>
        <Container>
          <input type="radio" id="plot" name="plotOrArea" />
          <CheckMark></CheckMark>
          Plot Size
        </Container>
        <Container>
          <input type="radio" id="plot" name="plotOrArea" />
          <CheckMark></CheckMark>
          Site Area
        </Container>

        {/* <input
          type="radio"
          id="plot"
          name="plotOrArea"
          style={{ margin: 10 }}
        />
        <label for="plot">Plot Size</label> */}
      </div>
    </div>
  );
};
